        /// <summary>
        /// Genera un hash BCrypt para el password proporcionado
        /// </summary>
        /// <param name="password">Password en texto plano</param>
        /// <returns>Hash BCrypt del password</returns>
        private string HashPassword(string password)
        {
            return BCrypt.Net.BCrypt.HashPassword(password, BCrypt.Net.BCrypt.GenerateSalt(12));
        }

        /// <summary>
        /// Verifica si el password proporcionado coincide con el hash almacenado
        /// </summary>
        /// <param name="password">Password en texto plano</param>
        /// <param name="hashedPassword">Hash del password almacenado</param>
        /// <returns>True si el password es correcto, False en caso contrario</returns>
        /// <example>
        /// // Ejemplo de uso en el controlador de autenticación:
        /// var user = await _context.Users.FirstOrDefaultAsync(u => u.Alias == username);
        /// if (user != null && ApplicationDbContext.VerifyPassword(password, user.Clave))
        /// {
        ///     // Password correcto, proceder con la autenticación
        /// }
        /// </example>
        public static bool VerifyPassword(string password, string hashedPassword)
        {
            return BCrypt.Net.BCrypt.Verify(password, hashedPassword);
        }

